-- Declare the Tax Authority Code that will be used all throughout Nebraska Default Data

DECLARE @TaxAuthorityCode NVARCHAR(10) = 'NE'
		, @TaxAuthorityId INT
SELECT @TaxAuthorityId = intTaxAuthorityId FROM tblTFTaxAuthority WHERE strTaxAuthorityCode = @TaxAuthorityCode AND ysnFilingForThisTA = 1

